            //       setCount(index);
            //       return index;
            //     }
            //   });
        })
        .catch(err=>{
            console.log("error");
        })
        }, [])

        console.log("a",test);

        return (
    <div>
   <div className="container">
        <div className="row">
            <h1>My Interview Portal</h1>

            <div className="col-md-12">
                <div className="panel panel-default">
                    <div className="panel-heading">{test.name}</div>
                    <div className="panel-body">
                        <form>
                            <label>{question!="" &&  test.questions[count].questionText}</label>
                            <div className="radio">
                                <label>
                                    <input type="radio" name="option" value="option1"/> Javascript Framework
                                </label>
                            </div>
                            <div className="radio">
                                <label>
                                    <input type="radio" name="option" value="option2"/> Java Library
                                </label>
                            </div>
                            <div className="radio">
                                <label>
                                    <input type="radio" name="option" value="option2"/> Programming Language
                                </label>
                            </div>
                        </form>
                    </div>
                    <div className="panel-footer">

                        <a href="test.html" className="btn btn-success">Next</a>
                        <a href="finish.html" className="pull-right btn btn-danger">Finish</a>

                    </div>
                </div>
            </div>
        </div>
    </div>

        {/* {(que.length==count && count!=0 ) ? complete() : ""} */}

    </div>
  )
}

export default Test
